import React from 'react';
import './newRecipe.css';
import { TextField, Button, Rating} from '@mui/material';
import Box from '@mui/material/Box';
import { Formik } from 'formik';

function NewRecipe(){
    return (
        <Box
            component="form"
            sx={{
                '& .MuiTextField-root': { m: 1, width: '25ch' },
            }}
            noValidate
            autoComplete="off"
        >
            <div className="mainContainer">
                <div className="centerPane">
                    <div className="formWindow" display="block">
                            <p>New Recipe</p>
                            <hr width="90%"/>
                            <Rating
                            name="simple-controlled"
                            value={value}
                            onChange={(event, newValue) => {
                                setValue(newValue);
                            }}
                            />
                            <TextField
                                required
                                id="outlined-required"
                                label="Name"
                                defaultValue="recipe name"
                            />
                            <TextField
                                id="outlined-multiline-static"
                                label="Ingredients"
                                multiline
                                rows={4}
                                defaultValue=""
                            />
                            <TextField
                                id="outlined-multiline-static"
                                label="Directions"
                                multiline
                                rows={4}
                                defaultValue=""
                            />
                            <br/><br/>
                            <TextField id="outlined-basic" label="Link" variant="outlined" />
                            <TextField id="outlined-basic" label="Prep Time" variant="outlined" />
                            <TextField id="outlined-basic" label="Cook Time" variant="outlined" />
                            <br/><br/>
                            <Button variant='contained' color='primary'>CANCEL</Button>
                            <Button variant='contained' color='primary'>DOWNLOAD</Button>
                            <Button variant='contained' color='primary'>SAVE</Button>
                    </div>
                </div>
            </div>
        </Box>
    );
}

export default NewRecipe;
